       <script>
        var intervalId; // Declare intervalId as a global variable

        function svgToImage(svg) {
          var svgData = new XMLSerializer().serializeToString(svg);
          var img = new Image();
          img.src = 'data:image/svg+xml;base64,' + btoa(svgData);
          return img;
        }

        function drawSvgOnCanvas(canvas, mySVG) {
          var ctx = canvas.getContext('2d');
          var svgData = new XMLSerializer().serializeToString(mySVG.get(0));
          var img = new Image();
          img.onload = function() {
            ctx.fillStyle = 'white'; // Set the canvas background to white
            ctx.fillRect(0, 0, canvas.width, canvas.height);
            ctx.drawImage(img, 0, 0);
          }
          img.src = 'data:image/svg+xml;base64,' + btoa(svgData);
        }

        function canvasToPng(canvas) {
          return canvas.toDataURL('image/png');
        }

        function pad(num, size) {
          var s = num+"";
          while (s.length < size) {
              s = "0" + s;
          }
          return s;
        }

        function saveSvgFrames(svg, timescale, mySVG) {
          console.log('saveSvgFrames');
          var canvas = document.createElement('canvas');
          canvas.width = svg.width.baseVal.value;
          canvas.height = svg.height.baseVal.value;

          var frameIndex = 0;
          intervalId = setInterval(function() { // Assign intervalId to a global variable
            // Draw the SVG onto the canvas
            drawSvgOnCanvas(canvas, mySVG);
            // Convert the canvas to PNG data
            var pngData = canvasToPng(canvas);
            console.log('Saved frame ' + frameIndex);
            // Create a download link for the PNG file
            var link = document.createElement('a');
            link.download = 'frame_' + pad(frameIndex, 3)  + '.png';
            link.href = pngData;
            link.click();
            frameIndex++;
          }, timescale);
        }


        var svg = document.getElementById('my_svg_element');
        var mySVG = $('#my_svg_element').drawsvg({
          callback: function() {
            console.log("animation complete");
            clearInterval(intervalId); // Stop the interval
          }
        });
        mySVG.drawsvg('animate');

        saveSvgFrames(svg, 500, mySVG); // Save a frame every second (1000ms)
      </script>
